    <script>
        var mymap = L.map('mapid').setView([10.209445, -83.834245], 14);
        L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
	    maxZoom: 19,
	    attribution: '&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
        }).addTo(mymap);

      


        const urlExp = "https://script.google.com/macros/s/AKfycbxtUwKz593_-ZGIxGico3nJw5q4ni2yWUWaQ-ted8jiKTpSEQSKtBvUY7CsJpnhKiQt/exec";

        fetch(urlExp)
            .then(d => d.json())
            .then(d => {
                d.forEach(e => {

                    let icon_entregado = L.icon({
                    iconUrl: 'delivered.svg',
                
                    iconSize:     [30, 40], // size of the icon
                    iconAnchor:   [10, 10], // point of the icon which will correspond to marker's location
                    popupAnchor:  [0, 0] // point from which the popup should open relative to the iconAnchor
                    });

                    let icon_pendiente = L.icon({
                    iconUrl: 'notDelivered.svg',
                
                    iconSize:     [30, 40], // size of the icon
                    iconAnchor:   [10, 10], // point of the icon which will correspond to marker's location
                    popupAnchor:  [0, 0] // point from which the popup should open relative to the iconAnchor
                    });

                    let exp = `<h1>征地地籍图(Plano)：<span class="catastro">${e[3]}<span/><h1/><h1>${e[2]}</h1>`

                    if (e[2] == "交付 Entregado") {
                        L.marker([e[0],e[1]],{icon: icon_entregado}).addTo(mymap)
                        .bindPopup(exp)
                    } else {
                        L.marker([e[0],e[1]],{icon: icon_pendiente}).addTo(mymap)
                        .bindPopup(exp)
                    } 

                     console.log(e[2])
                    
                })  
            })

            const urlKm = "https://script.google.com/macros/s/AKfycbyt712R8s5pmFzL_U7bt1IGkt9y8CjG60v7rFa_63G8vQesRoqdJb3prPdu4UFi8GJO/exec";
        
            fetch(urlKm)
            .then(d => d.json())
            .then(d => {
                d.forEach(e => {

                    let icon_km = L.icon({
                    iconUrl: 'kmSnipe1.svg',
                
                    iconSize:     [30, 30], // size of the icon
                    iconAnchor:   [10, 10], // point of the icon which will correspond to marker's location
                    popupAnchor:  [0, 0] // point from which the popup should open relative to the iconAnchor
                    });

                    

                    let km = `<h1>桩号：<span class="catastro">${e[2]}<span/><h1/>`

                  
                        L.marker([e[0],e[1]],{icon: icon_km}).addTo(mymap)
                        .bindPopup(km);
                   
                    
                })  
            })
            

            const urlpuentes ="https://script.google.com/macros/s/AKfycbztD4SmNF8B3X0IVzPqlo0lb-3RHQTrFceMiquBni_37aWJeQ7IiGqFXLDTjSm7jsyX/exec";

            fetch(urlpuentes)
            .then(d => d.json())
            .then(d => {
                d.forEach(e => {

                    let icon_puentes = L.icon({
                    iconUrl: 'bridge.png',
                
                    iconSize:     [30, 30], // size of the icon
                    iconAnchor:   [10, 10], // point of the icon which will correspond to marker's location
                    popupAnchor:  [0, 0] // point from which the popup should open relative to the iconAnchor
                    });

                    

                    let puente = `<h1>桥梁：<span class="catastro">${e[2]}<span/><h1/>`

                  
                        L.marker([e[0],e[1]],{icon: icon_puentes}).addTo(mymap)
                        .bindPopup(puente)

                        var circlePuente = L.circle([e[0], e[1]], {
                        color: "#ffffff",
                        fillColor: '#666',
                        fillOpacity: 0.05,
                        radius: 100,
                        weight: 1
                    }).addTo(mymap)
                   
                    
                })  
            })

            const urlPsv = "https://script.google.com/macros/s/AKfycbwRND9k2KTsWqEjnWSaE1ZIPKzFq6RBBrj7PsGnx8BjgGmONpDMkStFEviiwfJUUd836A/exec";

            fetch(urlPsv)
            .then(d => d.json())
            .then(d => {
                d.forEach(e => {

                  
                    
                    var circle = L.circle([e[0], e[1]], {
                        color: 'red',
                        fillColor: '#f03',
                        fillOpacity: 0.05,
                        radius: 500,
                        weight: 0.5
                    }).addTo(mymap)
                        .bindPopup(e[2]);
                   
                    
                })  
            })

            
            
                    


            const urlExpOpt = "https://script.google.com/macros/s/AKfycbxtUwKz593_-ZGIxGico3nJw5q4ni2yWUWaQ-ted8jiKTpSEQSKtBvUY7CsJpnhKiQt/exec";

            fetch(urlExpOpt)
            .then(d => d.json())
            .then(d => {
                d.forEach(e => {
                    
                    document.getElementById('select-location').innerHTML += `

                    <li class="list-group-item d-flex justify-content-between align-items-start">
                        <div class="ms-2 me-auto">
                            <div class="fw-bold">${e[3]}</div>
                        </div>
                        <span class="badge bg-primary rounded-pill">${e[2]}</span>
                    </li>

                    `
                })  
            })

            document.getElementById('select-location').addEventListener('change', function(e){
                let coords = e.target.value.split(",");
                mymap.flyTo(coords,18);
            })

            new Morris.Donut({
            // ID of the element in which to draw the chart.
            element: 'myfirstchart',
            // Chart data records -- each entry in this array corresponds to a point on
            // the chart.
            data: [
                { label: '交付 Entregados', value: 190 },
                { label: '无交付 Pendientes', value: 355 },
            ],
            // The name of the data record attribute that contains x-values.

            // A list of names of data record attributes that contain y-values.
            ykeys: ['value'],
            // Labels for the ykeys -- will be displayed when you hover over the
            // chart.
            labels: ['Value']
            });

if(!navigator.geolocation){
    console.log("Your browser dont support geolocation")
}else{
  setInterval(()=>{
    navigator.geolocation.getCurrentPosition(getPosition)
  }, 5000)
  
}

let marker, circle;

function getPosition(position){ 
  let lat = position.coords.latitude;
  let long = position.coords.longitude;
  let accuracy = position.coords.accuracy;

  if(marker){
    mymap.removeLayer(marker);
  }

  if(circle){
    mymap.removeLayer(circle);
  }

  let positionIcon = L.icon({
                    iconUrl: 'currentLocation_icon.svg',
                
                    iconSize:     [90, 90], // size of the icon
                    iconAnchor:   [45,75], // point of the icon which will correspond to marker's location
                    popupAnchor:  [0, 0] // point from which the popup should open relative to the iconAnchor
                    });

  marker = L.marker([lat,long], {icon: positionIcon})
  circle = L.circle([lat,long,{radius: accuracy}])

  


  let featureGroup = L.featureGroup([marker, circle]).addTo(mymap)

  //cmymap.fitBounds(featureGroup.getBounds())
}
